const eventualSafeNodes = (graph) => {
    const n = graph.length;
    const outDegree = graph.map(vs => vs.length);
    const revGraph = new Map();
    for (let u = 0; u < n; u++) {
        for (const v of graph[u]) {
            if (!revGraph.has(v)) {
                revGraph.set(v, []);
            }
            revGraph.get(v).push(u);
        }
    }
    const q = [];
    for (let i = 0; i < n; i++) {
        if (outDegree[i] === 0) {
            q.push(i);
        }
    }
    while (q.length > 0) {
        for (const u of revGraph.get(q.shift())) {
            outDegree[u]--;
            if (outDegree[u] === 0) {
                q.push(u);
            }
        }
    }
    const res = [];
    for (let i = 0; i < n; i++) {
        if (outDegree[i] === 0) {
            res.push(i);
        }
    }
    return res;
};
